        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    return (
      <div className={"App"}>
        <div className={"InputWrapper"}>
          <input placeholder={"Enter a value..."} />
          <button onClick={this.getMoviesList}>Submit</button>
        </div>
      </div>
    );
  }
}

export default App;
